import React from "react";
const Start2 = () => (
  <div>
    <p>
      Desngan desain elegan dan mewah pada UI serta muda digunakan dengan simple
      system untuk digunakan menunjang usaha secara maksimal dalam kebutuhan
      mencatat transaksi dan pembukuan pada bisnis toko shop store outlet,
      memudahkan dalam setiap aktivitas untuk bekerja secara efisien.
    </p>
  </div>
);

export default Start2;
